from PyQt5 import QtCore, QtGui, QtWidgets
import time
from board_generator import generator
from solver import find_empty_space, validator

class ThreadClass(QtCore.QThread):
    testValue = QtCore.pyqtSignal(list)
    def __init__(self, board, parent = None):
        super(ThreadClass,self).__init__(parent)
        self.board = board

    def solve(self):
        empty = find_empty_space(self.board)
        if not empty:
            return True
        else:
            row, col = empty
        for i in range(1,10):
            time.sleep(0.01)
            list = []
            list.append(row)
            list.append(col)
            list.append(i)
            self.testValue.emit(list)
            if validator(self.board, i, (row, col)):
                self.board[row][col] = i
                if self.solve():
                    return True
                self.board[row][col] = 0
        list = []
        list.append(row)
        list.append(col)
        list.append("")
        self.testValue.emit(list)
        return False

    def run(self):
        empty = find_empty_space(self.board)
        if not empty:
            return
        else:
            row, col = empty
        for i in range(1,10):
            list = []
            list.append(row)
            list.append(col)
            list.append(i)
            self.testValue.emit(list)
            if validator(self.board, i, (row, col)):
                self.board[row][col] = i
                if self.solve():
                    return
                self.board[row][col] = 0
        list = []
        list.append(row)
        list.append(col)
        list.append("")
        self.testValue.emit(list)
        return

